INSERT INTO `t_comment` VALUES (99896166, 'Jean-Paul S', 'Huile moteur sans les informations d\'homologation constructeur sur l\'étiquette alors que c\'est le cas sur le site... Pas de réponse à mes deux demandes d\'information ( 28 avril et 6 mai)  au bout de 15 jours du Market: la réponse automatique est : &quot;Nous comprenons tout à fait votre situation et tenons à vous présenter toutes nos excuses pour cette gêne occasionnée. Après vérification, nous vous informons que votre demande a été transmise au market pour les informations d\'homologation de l\'huile en question. Nous allons vous revenir dans ce cadre dans les plus brefs délais. Nous vous remercions de votre compréhension et restons à votre disposition pour tout complément d’information.&quot;  Résultat du délai bref : le délai de rétractation de 14 jours est passé et dans le doute je n\'utiliserai pas cette huile :( j\'ai déjà abimé un moteur en utilisant une huile non adaptée)  Pour moi il y a une suspicion de publicité mensongère... et j\'ai perdu le montant de la commande.  Je trouve cela très désobligeant.... D\'ailleurs je viens ce jour d\'effectuer un signalement sur https://signal.conso.gouv.fr/', 'Publié le 12/05/2022', 'Pièce achetée pour FIAT PUNTO EVO (199_) 1.3 D Multijet (95Cv)', 0, '2022-05-25 12:07:14', 18655062, '4.5');
